<script>
var time = 0, d, time_string;
function show_nope() {
    if (document.getElementById("result").style.display != "none")
        return;
    document.getElementById("nope").style.display = "block";
}
function start_timing() {
    d = new Date();
    time = d.getTime();
}
function finish() {
    d = new Date();
    if (document.getElementById("result").style.display != "none")
    	return;
    time = d.getTime() - time;
    time = Math.floor(time / 10);
   	time_string = time / 100;
    if (time % 100 == 0)
        time_string += ".00";
    else if (time % 10 == 0)
        time_string += "0";
    document.getElementById("time").innerHTML = "恭喜你找到了美队！用时" + time_string + "秒。";
    document.getElementById("result").style.display = "contents";
    document.getElementById("nope").style.display = "none";
}
</script>
